    private static Object[] getData(int number, Integer value) {
        Object[] objects = new Object[number];

        for (int i = 0; i < objects.length; i++) {
            if (value == null) {
                objects[i] = new Object[]{System.currentTimeMillis() + 600 * 200, new Random().nextDouble()};

            } else {
                objects[i] = new Object[]{System.currentTimeMillis() + 600 * new Random().nextInt(), value};

                try {
                    if (value != null) {
                        Thread.sleep(300);
                    }
                } catch (Exception e) {
                    e.printStackTrace();
                }
            }
        }
        return objects;
    }

